style.css:
@-moz-document url("https://www.naver.com/") {
html{overflow:hidden}

#search_btn{background-color:#00c73c!important}
.green_window{border-color:#19ce60!important}

#wrap>div:not(#header):not(#container),
#header>div:not(:first-child),
.group_flex>:not(#search),
#container>:not(#NM_INT_RIGHT),
#NM_INT_RIGHT>div>div:not(.sc_my):not(#account)
{display:none!important}

#NM_INT_RIGHT{position:fixed!important;right:0!important;top:0!important;z-index:9999!important}
#header,#header>div,#header>div>div{height:100vh!important;width:100vw!important;padding:unset!important;border:unset!important;background:unset!important}
#header{border-top:2px solid #00c73c!important;background:url(data:image/png;base64,)no-repeat!important;background-size:350px 69px!important;background-attachment:fixed!important;background-position:50% 38%!important;}

#header .search_area{left:calc(50% - 293px)!important}
}

@-moz-document domain("search.naver.com") {
.section_rbn,.broadcast_kin,[href*="https://campaign.naver.com"]{display:none!important}
.ah_roll,.sub_pack,#_nx_footer_realtime,#aside,#rankingLoadingLine+div{display:none!important}
#wrap{background:none!important}
}

@-moz-document domain("naver.com") {
#detailContextAd,#veta_top,iframe[src*="ad.naver.com"],.ad_section,li._calledAdVisibleLog,#adpostArea,.post_adpost,#pcDetailBannerArea,#veta_branding,[id^="adPostInjectArea"],.power_link,#_banner_area_,.ad,.banner,[href="http://music.naver.com/buy/index.nhn?list=unlimit"],.searchad,.float_bnr,.renew_notice,.api_banner_home,.api_banner,#adContextMobile,.add_home_android,.section_banner,.section_opendic,.entry_quiz_area,._integratedAccountLayerDimmed,.ly_wrap,.viewer.cuttoon .ly_dim,#ssp-adpost,.happybean_layer,#anniversaryLayer,#whale_promotion_banner,._popupLayerDimmed{display:none!important}
#PM_ID_ct{border-top:2px solid #00c73c!important}
}
